import React from 'react'
import Book from '../components/book'

const BooksContainer = props => {
    let bookList = () => {
        return props.books.forEach(book => <Book book={book}/>)
    }

    return (
        <>
            {bookList()}
        </>
    )
}

export default BooksContainer
